import React from "react";


const Card=(props)=>{
return(
    <>
        <div className="col-md-4 my-5 text-center">
<div className="card">
  <img className="card-img-top" src={props.imgsrc} alt={props.imgsrc}/>
  <div className="card-body">
    <p className="card-text">{props.det}</p>
    <h3 className="card-text">{props.fee}</h3>
    
  </div>
</div>
</div>
    
    </>
    )
  }
export default Card;
